INSERT INTO `gen_template` VALUES (184, 29, 'application.ftl', '${backendPath}/src/main/resources/application.yaml', 'springboot项目配置文件', 'server:\n  port: 8080\n  servlet:\n    context-path: /${projectName}\n\nspring:\n  # 项目名配置\n  application:\n    name: ${projectName}\n    version: \'${projectVersion}\'\n    description: \'${projectDesc}\'\n\n  main:\n    # 允许循环依赖\n    allow-circular-references: true\n\n  # 配置策略\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n\n  # jackson配置\n  jackson:\n    date-format: yyyy-MM-dd HH:mm:ss\n    time-zone: GMT+8\n\n  # 数据源配置\n  datasource:\n    driver-class-name: ${databaseDriverClassName}\n    url: ${databaseUrl}\n    username: ${databaseUsername}\n    password: ${databasePassword}\n\n# mybatis-plus配置\nmybatis-plus:\n  # mapper配置文件\n  mapper-locations: classpath*:mapper/**/*.xml\n  configuration:\n    # 日志配置\n    log-impl: org.apache.ibatis.logging.slf4j.Slf4jImpl\n\nknife4j:\n  enable: true', 0, '2025-05-14 17:56:37', '2025-06-12 10:47:48', 0);
INSERT INTO `gen_template` VALUES (185, 29, 'Application.ftl', '${backendPath}/src/main/java/${projectPackageSlash}/${projectNameSlash}/${projectNamePascal}Application.java', '主启动类', 'package ${projectPackage}.${projectNameDot};\n\nimport org.mybatis.spring.annotation.MapperScan;\nimport org.springframework.boot.SpringApplication;\nimport org.springframework.boot.autoconfigure.SpringBootApplication;\n\n/**\n * ${projectNamePascal}主启动类\n */\n@MapperScan(\"${projectPackage}.${projectNameDot}.mapper\")\n@SpringBootApplication(scanBasePackages = \"${projectPackage}.${projectNameDot}.*\")\npublic class ${projectNamePascal}Application {\n\n    public static void main(String[] args) {\n        SpringApplication.run(${projectNamePascal}Application.class, args);\n    }\n\n}', 0, '2025-05-14 17:56:37', '2025-05-20 11:11:47', 0);
INSERT INTO `gen_template` VALUES (187, 29, 'CorsConfig.ftl', '${backendPath}/src/main/java/${projectPackageSlash}/${projectNameSlash}/common/config/CorsConfig.java', '跨域配置类', 'package ${projectPackage}.${projectNameDot}.common.config;\n\nimport org.springframework.beans.factory.annotation.Value;\nimport org.springframework.boot.autoconfigure.condition.ConditionalOnProperty;\nimport org.springframework.context.annotation.Bean;\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.web.cors.CorsConfiguration;\nimport org.springframework.web.cors.UrlBasedCorsConfigurationSource;\nimport org.springframework.web.filter.CorsFilter;\n\nimport java.util.List;\n\n/**\n * 跨域配置\n */\n@Configuration\n@ConditionalOnProperty(name = \"web.cors.enable\", havingValue = \"true\", matchIfMissing = true)\npublic class CorsConfig {\n\n    /**\n     * 跨域过期时间。单位：秒\n     */\n    @Value(\"<#noparse>${web.cors.max-age:3600}</#noparse>\")\n    private Long maxAge;\n\n    /**\n     * 跨域是否传递cookie\n     */\n    @Value(\"<#noparse>${web.cors.allow-credentials:true}</#noparse>\")\n    private Boolean allowCredentials;\n\n    /**\n     * 允许跨域的请求头\n     */\n    @Value(\"<#noparse>#{\'${web.cors.allowed-headers:*}\'.split(\',\')}</#noparse>\")\n    private List<String> allowedHeaders;\n\n    /**\n     * 允许跨域的方法\n     */\n    @Value(\"<#noparse>#{\'${web.cors.allowed-methods:*}\'.split(\',\')}</#noparse>\")\n    private List<String> allowedMethods;\n\n    /**\n     * 允许跨域的源\n     */\n    @Value(\"<#noparse>#{\'${web.cors.allowed-origins:*}\'.split(\',\')}</#noparse>\")\n    private List<String> allowedOrigins;\n\n    /**\n     * 允许跨域的响应头\n     */\n    @Value(\"<#noparse>#{\'${web.cors.expose-headers:Content-Disposition,Authorization,token,Cookie}\'.split(\',\')}</#noparse>\")\n    private List<String> exposedHeaders;\n\n    @Bean\n    public CorsFilter corsFilter() {\n        final UrlBasedCorsConfigurationSource source = new UrlBasedCorsConfigurationSource();\n        final CorsConfiguration corsConfiguration = new CorsConfiguration();\n        corsConfiguration.setMaxAge(maxAge);\n        corsConfiguration.setAllowCredentials(allowCredentials);\n        corsConfiguration.setAllowedHeaders(allowedHeaders);\n        corsConfiguration.setAllowedMethods(allowedMethods);\n        corsConfiguration.setAllowedOriginPatterns(allowedOrigins);\n        corsConfiguration.setExposedHeaders(exposedHeaders);\n        source.registerCorsConfiguration(\"/**\", corsConfiguration);\n        return new CorsFilter(source);\n    }\n\n}\n', 0, '2025-05-16 16:11:20', '2025-07-30 10:55:00', 0);
INSERT INTO `gen_template` VALUES (188, 29, 'Knife4jConfig.ftl', '${backendPath}/src/main/java/${projectPackageSlash}/${projectNameSlash}/common/config/Knife4jConfig.java', 'Knife4j配置类', 'package ${projectPackage}.${projectNameDot}.common.config;\n\nimport com.github.xiaoymin.knife4j.spring.annotations.EnableKnife4j;\nimport io.swagger.v3.oas.models.OpenAPI;\nimport io.swagger.v3.oas.models.info.Info;\nimport org.springframework.beans.factory.annotation.Value;\nimport org.springframework.context.annotation.Bean;\nimport org.springframework.context.annotation.Configuration;\n\n/**\n * 创建Knife4j配置\n */\n@Configuration\n@EnableKnife4j\npublic class Knife4jConfig {\n\n    @Value(\"<#noparse>${spring.application.name:}</#noparse>\")\n    private String applicationName;\n\n    @Value(\"<#noparse>${spring.application.version:}</#noparse>\")\n    private String version;\n\n    @Value(\"<#noparse>${spring.application.description:}</#noparse>\")\n    private String description;\n\n    @Bean\n    public OpenAPI customOpenAPI() {\n        return new OpenAPI()\n                .info(new Info()\n                        .title(applicationName)\n                        .version(version)\n                        .description(description)\n                );\n    }\n\n}\n', 0, '2025-05-16 16:12:47', '2025-08-06 14:40:59', 0);
