INSERT INTO `gen_template` VALUES (256, 30, 'index.html.ftl', '${frontendPath}/index.html', '根文件', '<!doctype html>\n<html lang=\"en\">\n  <head>\n    <meta charset=\"UTF-8\" />\n    <link rel=\"icon\" type=\"image/svg+xml\" href=\"/favicon.ico\" />\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n    <title>%VITE_APP_TITLE%</title>\n  </head>\n  <body>\n    <div id=\"app\"></div>\n    <script type=\"module\" src=\"/src/main.ts\"></script>\n  </body>\n</html>\n', 0, '2025-08-07 10:03:11', '2025-08-07 10:03:11', 0);
INSERT INTO `gen_template` VALUES (257, 30, 'vite.config.ts.ftl', '${frontendPath}/vite.config.ts', 'vite配置文件', 'import { resolve } from \'path\'\nimport { defineConfig } from \'vite\'\nimport vue from \'@vitejs/plugin-vue\'\nimport { createSvgIconsPlugin } from \'vite-plugin-svg-icons\'\n\n// 参考：https://cn.vitejs.dev/config/\nexport default defineConfig({\n	base: \'./\',\n	resolve: {\n		// 配置别名\n		alias: {\n			\'@\': resolve(__dirname, \'./src\'),\n			\'vue-i18n\': \'vue-i18n/dist/vue-i18n.cjs.js\'\n		}\n	},\n	plugins: [\n		vue(),\n		createSvgIconsPlugin({\n			iconDirs: [resolve(__dirname, \'src/icons/svg\')],\n			symbolId: \'icon-[dir]-[name]\'\n		})\n	],\n	server: {\n		host: \'0.0.0.0\',\n		port: 5000, // 端口号\n		open: false // 是否自动打开浏览器\n	}\n})\n', 0, '2025-08-07 10:04:08', '2025-08-07 10:04:08', 0);
INSERT INTO `gen_template` VALUES (258, 30, 'tsconfig.json.ftl', '${frontendPath}/tsconfig.json', 'ts配置文件', '{\n  \"compilerOptions\": {\n    \"baseUrl\": \".\",\n    \"target\": \"esnext\",\n    \"useDefineForClassFields\": true,\n    \"module\": \"esnext\",\n    \"moduleResolution\": \"node\",\n    \"strict\": true,\n    \"jsx\": \"preserve\",\n    \"skipLibCheck\": true,\n    \"allowJs\": true,\n    \"sourceMap\": true,\n    \"resolveJsonModule\": true,\n    \"esModuleInterop\": true,\n    \"allowSyntheticDefaultImports\": true,\n    \"lib\": [\"esnext\", \"dom\"],\n    \"types\": [\n      \"web-bluetooth\",\n      \"vite/client\"\n    ],\n    \"paths\": {\n      \"@/*\": [\"./src/*\"]\n    },\n    \"compilerOptions\": {\n      \"types\": [\"vite-plugin-svg-icons/client\"]\n    }\n  },\n  \"include\": [\"src/**/*.ts\", \"src/**/*.d.ts\", \"src/**/*.tsx\", \"src/**/*.vue\"],\n  \"exclude\": [\"node_modules\"]\n}\n', 0, '2025-08-07 10:04:37', '2025-08-07 10:04:37', 0);
INSERT INTO `gen_template` VALUES (259, 30, 'package.json.ftl', '${frontendPath}/package.json', '包管理', '{\n  \"name\": \"${projectName}\",\n  \"version\": \"${projectVersion}\",\n  \"type\": \"module\",\n  \"scripts\": {\n    \"dev\": \"vite\",\n    \"build\": \"vite build\",\n    \"preview\": \"vite preview\",\n    \"lint\": \"eslint --fix --ext .vue,.jsx,.ts,.tsx .\"\n  },\n  \"dependencies\": {\n    \"@element-plus/icons-vue\": \"2.3.1\",\n    \"@vueuse/core\": \"^9.1.1\",\n    \"axios\": \"1.8.2\",\n    \"element-plus\": \"2.9.3\",\n    \"pinia\": \"^3.0.3\",\n    \"pinia-plugin-persistedstate\": \"^4.4.1\",\n    \"qs\": \"6.10.3\",\n    \"sortablejs\": \"^1.15.6\",\n    \"vue\": \"^3.5.17\",\n    \"vue-router\": \"4.2.5\",\n    \"xe-utils\": \"^3.5.4\"\n  },\n  \"devDependencies\": {\n    \"@babel/types\": \"7.24.0\",\n    \"@types/node\": \"20.11.28\",\n    \"@types/nprogress\": \"0.2.3\",\n    \"@types/qs\": \"6.9.12\",\n    \"@types/sm-crypto\": \"0.3.4\",\n    \"@types/sortablejs\": \"1.15.8\",\n    \"@vitejs/plugin-vue\": \"5.0.5\",\n    \"@vue/compiler-sfc\": \"3.4.30\",\n    \"@vue/eslint-config-prettier\": \"9.0.0\",\n    \"@vue/eslint-config-typescript\": \"13.0.0\",\n    \"@vue/tsconfig\": \"0.5.1\",\n    \"eslint\": \"8.57.0\",\n    \"eslint-plugin-vue\": \"9.23.0\",\n    \"prettier\": \"3.2.5\",\n    \"sass\": \"1.72.0\",\n    \"typescript\": \"5.4.2\",\n    \"vite\": \"5.3.1\",\n    \"vite-plugin-svg-icons\": \"2.0.1\",\n    \"vite-plugin-vue-setup-extend\": \"0.4.0\",\n    \"vue-tsc\": \"2.0.22\"\n  },\n  \"keywords\": [\n    \"vue\",\n    \"vue3\",\n    \"vuejs\",\n    \"vite\",\n    \"element-plus\",\n    \"${projectName}\"\n  ],\n  \"license\": \"MIT\"\n}\n', 0, '2025-08-07 10:05:20', '2025-08-07 16:02:57', 0);
INSERT INTO `gen_template` VALUES (260, 30, '.prettierrc.cjs.ftl', '${frontendPath}/.prettierrc.cjs', '代码格式化配置文件', '// 参考：https://prettier.io/docs/en/options.html\nmodule.exports = {\n	// 超过指定值换行\n	printWidth: 150,\n	// 制表符宽度\n	tabWidth: 2,\n	// 使用制表符缩进\n	useTabs: true,\n	// 句尾不使用分号\n	semi: false,\n	// 使用单引号\n	singleQuote: true,\n	// 在 JSX 文件中使用单引号代替双引号\n	jsxSingleQuote: true,\n	// 在对象或数组最后一个元素后面是否加逗号，可选值\"[none：不追加 | es5：追加]\n	trailingComma: \'none\',\n	// 在对象，数组括号与代码之间加空格 \"{ foo: bar }\"\n	bracketSpacing: true,\n	// 将多行 JSX 元素的 > 放置于最后一行的末尾，而非换行\n	jsxBracketSameLine: true,\n	//(x) => {} 箭头函数参数只有一个时是否要有小括号，可选值\"[always：(x) => x | avoid：x => x]\n	arrowParens: \'avoid\',\n	// 使用默认的折行标准，可选值\"[always|never|preserve]\"\n	proseWrap: \'preserve\',\n	// 指定HTML文件的全局空格敏感度，可选值\"[css|strict|ignore]\"\n	htmlWhitespaceSensitivity: \'css\',\n	// 结尾时换行符，默认值lf，可选值\"[auto|lf|crlf|cr]\"\n	endOfLine: \'auto\'\n}\n', 0, '2025-08-07 10:05:55', '2025-08-07 10:05:55', 0);
