INSERT INTO `gen_template` VALUES (267, 30, 'main.ts.ftl', '${frontendPath}/src/main.ts', '主启动文件', 'import { createApp } from \'vue\'\nimport { createPinia } from \'pinia\'\nimport piniaPluginPersistedstate from \'pinia-plugin-persistedstate\'\nimport ElementPlus from \'element-plus\'\nimport App from \'@/App.vue\'\nimport { router } from \'@/router\'\nimport \'virtual:svg-icons-register\'\nimport SvgIcon from \'@/components/svg-icon\'\nimport \'@/icons/iconfont/iconfont\'\nimport \'element-plus/dist/index.css\'\nimport \'@/styles/index.scss\'\nimport * as ElementPlusIconsVue from \'@element-plus/icons-vue\'\n\nconst app = createApp(App)\nconst pinia = createPinia()\npinia.use(piniaPluginPersistedstate)\n//使用element-plus图标\nfor (const [key, component] of Object.entries(ElementPlusIconsVue)) {\n	app.component(key, component)\n}\n\napp.use(router)\napp.use(SvgIcon)\napp.use(pinia)\napp.use(ElementPlus)\napp.mount(\'#app\')\n', 0, '2025-08-07 10:11:07', '2025-08-07 10:11:07', 0);
INSERT INTO `gen_template` VALUES (268, 30, 'App.vue.ftl', '${frontendPath}/src/App.vue', '主页面文件', '<template>\n	<el-config-provider :locale=\"zhCn\">\n		<router-view></router-view>\n	</el-config-provider>\n</template>\n\n<script setup lang=\"ts\">\nimport { RouterView } from \'vue-router\'\nimport zhCn from \'element-plus/dist/locale/zh-cn.mjs\'\nimport dayjs from \'dayjs\'\nimport \'dayjs/locale/zh-cn\'\n\ndayjs.locale(\'zh-cn\')\n</script>\n', 0, '2025-08-07 10:11:56', '2025-08-07 10:11:56', 0);
INSERT INTO `gen_template` VALUES (269, 30, 'tool.ts.ftl', '${frontendPath}/src/utils/tool.ts', '工具类', 'import type { App, Component, Plugin } from \'vue\' // 添加 Component 类型\nimport { useClipboard } from \'@vueuse/core\'\nimport { ElMessage } from \'element-plus/es\'\n\nconst { copy, isSupported } = useClipboard()\n\n// 复制到剪切板\nexport const copyToClipboard = (text: string): Promise<void> => {\n	return new Promise((resolve, reject) => {\n		if (isSupported) {\n			copy(text)\n				.then(() => {\n					resolve()\n				})\n				.catch(err => {\n					console.error(\'复制失败:\', err)\n					ElMessage.error(\'复制失败\')\n					reject()\n				})\n		} else {\n			// 不支持时的降级处理\n			console.warn(\'当前浏览器不支持 Clipboard API\')\n			ElMessage.warning(\'当前浏览器不支持自动复制功能\')\n			reject()\n		}\n	})\n}\n\n// 修改泛型约束为 Component\nexport const withInstall = <T extends Component>(component: T, alias?: string) => {\n	const comp = component as any\n	comp.install = (app: App) => {\n		app.component(comp.__name || comp.displayName, component)\n		if (alias) {\n			app.config.globalProperties[alias] = component\n		}\n	}\n	return component as T & Plugin\n}\n', 0, '2025-08-07 10:12:27', '2025-08-07 10:12:27', 0);
INSERT INTO `gen_template` VALUES (270, 30, 'router-guard.ts.ftl', '${frontendPath}/src/utils/router-guard.ts', '路由守卫', 'import { useAppStore, NavbarTag } from \'@/store/app-store\'\nimport { MenuInfo, useUserStore } from \'@/store/user-store\'\nimport { Router, RouteRecordRaw } from \'vue-router\'\n\n// 路由数据\nexport interface RouteMetaData {\n	// 路径\n	path: string\n	// 完整路径\n	fullPath: string\n	// 组件名称\n	name: string\n	// 标题\n	title: string\n	// 图标\n	icon: string\n	// 缓存\n	cache: boolean\n	// 隐藏\n	hidden: boolean\n	// 类型 0-目录、1-菜单、2-按钮\n	type: number\n}\n\n// 路由白名单名称列表\nconst whiteLists = [\'Login\']\n\nexport const routerGuard = (router: Router) => {\n	// 路由拦截\n	router.beforeEach((to, from, next) => {\n		const routeMetaData: RouteMetaData = {\n			name: to.name as string,\n			path: to.path,\n			fullPath: to.fullPath,\n			title: to.meta?.title as string,\n			icon: to.meta?.icon as string,\n			cache: to.meta?.cache as boolean,\n			type: to.meta?.type as number,\n			hidden: to.meta?.hidden as boolean\n		}\n\n		console.log(to, from, routeMetaData)\n\n		// 如果包含白名单，直接放行\n		if (whiteLists.includes(routeMetaData.name)) {\n			next()\n			return\n		}\n\n		const userStore = useUserStore()\n		// 是否登录\n		// if (!userStore.isLogin) {\n		// 	// 未登录，跳转登录页面\n		// 	next({ name: \'Login\' })\n		// 	return\n		// }\n		// 是否添加路由\n		if (!userStore.isAddRoutes) {\n			// 1. 添加路由\n			const routeList = buildRouteList(userStore.menuList)\n			routeList.forEach((item: any) => {\n				// console.log(\'item\', item)\n				router.addRoute(\'Layout\', item)\n			})\n\n			// 3. 设置添加路由标记\n			userStore.setAddRouteFlag()\n			//添加完路由需要重新执行一次路由跳转，否则会出现空白页面\n			next({ ...to, replace: true })\n			return\n		}\n\n		// 登录，添加标签\n		const appStore = useAppStore()\n		// 添加标签\n		if (routeMetaData.title) {\n			const tag: NavbarTag = {\n				...routeMetaData\n			}\n			appStore.addTag(tag)\n		}\n\n		// 设置面包屑\n		appStore.setBreadcrumb(routeMetaData)\n\n		// 添加缓存路由\n		if (routeMetaData.cache && routeMetaData.name) {\n			appStore.addCacheComponent(routeMetaData.name)\n		}\n\n		next()\n	})\n}\n\n// 匹配views里面所有的.vue文件\nconst modules = import.meta.glob(\'@/views/**/*.vue\')\nconst loadView = (component: string | undefined) => {\n	let res\n	for (const path in modules) {\n		const dir = path.split(\'/src/views/\')[1].split(\'.vue\')[0]\n		if (dir === component) {\n			res = () => modules[path]()\n			return res\n		}\n	}\n}\n\n// 构建路由\nconst buildRouteList = (menuList: MenuInfo[]): RouteRecordRaw[] => {\n	return menuList.map((item: MenuInfo) => {\n		const menu = {\n			...item\n		} as RouteRecordRaw\n		// 如果是目录，则需要构建子路由\n		if (item.meta.type === 0 && item.children && item.children.length > 0) {\n			menu.children = buildRouteList(item.children)\n		}\n		// 如果是菜单，则需要构建组件\n		if (item.meta.type === 1) {\n			menu.component = loadView(item.component)\n		}\n		return menu\n	})\n}\n', 0, '2025-08-07 10:13:06', '2025-08-07 10:13:06', 0);
INSERT INTO `gen_template` VALUES (271, 30, 'request.ts.ftl', '${frontendPath}/src/utils/request.ts', '请求工具类', 'import axios from \'axios\'\nimport qs from \'qs\'\nimport { ElMessage } from \'element-plus\'\n\n// axios实例\nconst service = axios.create({\n	baseURL: import.meta.env.VITE_API_URL as any,\n	timeout: 60000,\n	headers: { \'Content-Type\': \'application/json;charset=UTF-8\' },\n	withCredentials: true // 允许携带cookie\n})\n\n// 请求拦截器\nservice.interceptors.request.use(\n	(config: any) => {\n		// 追加时间戳，防止GET请求缓存\n		if (config.method?.toUpperCase() === \'GET\') {\n			config.params = { ...config.params, t: new Date().getTime() }\n		}\n\n		if (Object.values(config.headers).includes(\'application/x-www-form-urlencoded\')) {\n			config.data = qs.stringify(config.data)\n		}\n\n		return config\n	},\n	error => {\n		return Promise.reject(error)\n	}\n)\n\n// 响应拦截器\nservice.interceptors.response.use(\n	response => {\n		if (response.status !== 200) {\n			return Promise.reject(new Error(response.statusText || \'Error\'))\n		}\n\n		//如果是文件下载请求\n		if (response.config.responseType === \'blob\') {\n			//直接返回响应数据\n			return response\n		}\n\n		const res = response.data\n		// 响应成功\n		if (res.code === 200) {\n			return res\n		}\n\n		// 错误提示\n		ElMessage.error(res.message)\n\n		return Promise.reject(new Error(res.message || \'Error\'))\n	},\n	error => {\n		ElMessage.error(error.message)\n		return Promise.reject(error)\n	}\n)\n\n// 导出 axios 实例\nexport default service\n', 0, '2025-08-07 10:13:43', '2025-08-07 10:13:43', 0);
INSERT INTO `gen_template` VALUES (272, 30, 'enum.ts.ftl', '${frontendPath}/src/utils/enum.ts', '枚举工具类', '/**\n * 获取枚举标签\n */\nexport const getLabel = (value: any, enumList: EnumItem[]): string => {\n	return <string>enumList.find(item => item.value === value)?.label\n}\n\n/**\n * 枚举项\n */\nexport interface EnumItem {\n	/**\n	 * 枚举值\n	 */\n	value: any\n\n	/**\n	 * 枚举标签\n	 */\n	label: string\n}\n', 0, '2025-08-07 10:14:21', '2025-08-07 10:14:21', 0);
INSERT INTO `gen_template` VALUES (273, 30, 'download.ts.ftl', '${frontendPath}/src/utils/download.ts', '文件下载工具类', 'import { ElMessage } from \'element-plus\'\nimport service from \'@/utils/request\'\n\n/**\n * 统一文件下载工具\n *\n * @param url 请求地址\n */\nexport const downloadFile = (url: string): Promise<void> => {\n	return new Promise((resolve, reject) => {\n		service\n			.get(url, {\n				responseType: \'blob\'\n			})\n			.then((response: any) => {\n				// 提取文件名\n				const contentDisposition = response.headers[\'content-disposition\']\n				let filename = \'\'\n\n				if (contentDisposition) {\n					// 正则匹配 filename* 或 filename（支持带引号或不带引号的格式）\n					const filenameStarMatch = contentDisposition.match(/filename\\*=[\'\"]?(?:UTF-8[\'\"]?)?\'\'?([^;]+)/i)\n					const filenameMatch = contentDisposition.match(/filename=[\'\"]?([^;]+)[\'\"]?/i)\n\n					// 优先使用 filename*\n					if (filenameStarMatch && filenameStarMatch[1]) {\n						filename = decodeURIComponent(filenameStarMatch[1].trim())\n					}\n					// 回退到 filename（需解码 URL 编码）\n					else if (filenameMatch && filenameMatch[1]) {\n						filename = decodeURIComponent(filenameMatch[1].trim().replace(/\\+/g, \'%20\')) // 替换 + 为 %20（兼容 URLEncoder 格式）\n					}\n				}\n\n				// 创建下载链接并触发下载\n				const downloadUrl = window.URL.createObjectURL(new Blob([response.data]))\n				const a = document.createElement(\'a\')\n				a.href = downloadUrl\n				a.download = filename\n				document.body.appendChild(a)\n				a.click()\n				window.URL.revokeObjectURL(downloadUrl)\n				document.body.removeChild(a)\n\n				// 成功时直接resolve，不返回true\n				resolve()\n			})\n			.catch((error: any) => {\n				console.error(\'导出失败:\', error)\n				let errorMessage = \'导出失败，请稍后重试或联系管理员\'\n\n				if (error.response) {\n					errorMessage = `导出失败，服务器返回状态码：<#noparse>${error.response.status}</#noparse>`\n				} else if (error.request) {\n					errorMessage = \'导出失败，请检查网络连接或稍后重试\'\n				}\n\n				ElMessage.error(errorMessage)\n				// 失败时reject错误信息\n				reject(new Error(errorMessage))\n			})\n	})\n}\n', 0, '2025-08-07 10:14:51', '2025-08-07 11:00:44', 0);
INSERT INTO `gen_template` VALUES (274, 30, 'shims.d.ts.ftl', '${frontendPath}/src/types/shims.d.ts', '类型约束文件', 'declare module \'*.svg\'\ndeclare module \'*.png\'\ndeclare module \'*.jpg\'\ndeclare module \'*.gif\'\ndeclare module \'*.scss\'\ndeclare module \'*.ts\'\ndeclare module \'*.js\'\n\ndeclare module \'*.vue\' {\n	import type { DefineComponent } from \'vue\'\n	const component: DefineComponent<{}, {}, any>\n	export default component\n}\n', 0, '2025-08-07 10:15:23', '2025-08-07 10:15:23', 0);
