INSERT INTO `gen_template` VALUES (276, 30, 'variables.scss.ftl', '${frontendPath}/src/styles/variables.scss', 'css变量文件', ':root {\n  --el-color-primary: #1e97f8;\n\n  --theme-aside-width: 200px;\n  --theme-header-height: 80px;\n  --theme-border-color-light: #f1f2f3;\n  --theme-logo-text-color: #ffffff;\n\n  --theme-menu-text-color: #333333;\n  --theme-menu-bg-color: #ffffff;\n  --theme-menu-border-color: var(--el-color-primary);\n  --theme-menu-hover-color: var(--el-color-primary);\n  --theme-menu-hover-bg-color: var(--el-color-primary-light-9);\n\n  --theme-header-bg-color: var(--el-color-primary);\n  --theme-header-text-color: #ffffff;\n  --theme-header-hover-color: rgba(0, 0, 0, 0.1);\n\n  --theme-main-bg-color: #f0f2f5;\n}\n.el-card {\n  &:not(:first-child) {\n    margin-top: 10px;\n  }\n}\n', 0, '2025-08-07 10:16:48', '2025-08-07 10:16:48', 0);
INSERT INTO `gen_template` VALUES (277, 30, 'layout.scss.ftl', '${frontendPath}/src/styles/layout.scss', '布局css文件', '* {\n  margin: 0;\n  padding: 0;\n  outline: none !important;\n}\n\nhtml,\nbody,\n#app {\n  margin: 0;\n  padding: 0;\n  width: 100%;\n  height: 100%;\n  font-family: \'Helvetica Neue\', Helvetica, \'PingFang SC\', \'Hiragino Sans GB\', \'Microsoft YaHei\', \'微软雅黑\', Arial, sans-serif;\n  font-weight: 400;\n  -webkit-font-smoothing: antialiased;\n  -webkit-tap-highlight-color: transparent;\n  font-size: 14px;\n  overflow: hidden;\n  position: relative;\n}\n\na,\na:focus,\na:hover {\n  cursor: pointer;\n  color: inherit;\n  text-decoration: none;\n}\n\n.layout-container {\n  width: 100%;\n  height: 100%;\n  .layout-sidebar {\n    background: var(--theme-menu-bg-color);\n    border-right: var(--theme-border-color-light) 1px solid;\n    height: inherit;\n    width: var(--theme-aside-width);\n    position: relative;\n    display: flex;\n    flex-direction: column;\n    overflow-x: hidden !important;\n    .el-scrollbar__view {\n      overflow: hidden;\n    }\n  }\n  .layout-header {\n    margin-left: 15px;\n    padding: 0 !important;\n    display: flex;\n    flex-direction: column;\n    width: 100%;\n    height: var(--theme-header-height);\n  }\n  .layout-main {\n    padding: 0 !important;\n    overflow: hidden;\n    width: 100%;\n    background-color: var(--theme-main-bg-color);\n    .layout-card{\n      min-height: calc(100vh - 30px - var(--theme-header-height));\n    }\n  }\n  .layout-scrollbar {\n    height: calc(100vh - 30px - var(--theme-header-height));\n    padding: 15px;\n  }\n  .layout-space {\n    margin-bottom: 15px\n  }\n}\n\n/* fade 过渡动画样式 */\n.fade-enter-active,\n.fade-leave-active {\n  transition: opacity 0.3s ease;\n}\n\n.fade-enter-from,\n.fade-leave-to {\n  opacity: 0;\n}\n\n/* 可选：slide 过渡动画样式 */\n.slide-enter-active,\n.slide-leave-active {\n  transition: all 0.15s ease;\n}\n\n.slide-enter-from {\n  transform: translateX(20px);\n  opacity: 0;\n}\n\n.slide-leave-to {\n  transform: translateX(-20px);\n  opacity: 0;\n}\n\n/* 可选：zoom 过渡动画样式 */\n.zoom-enter-active,\n.zoom-leave-active {\n  transition: all 0.3s ease;\n}\n\n.zoom-enter-from {\n  transform: scale(0.95);\n  opacity: 0;\n}\n\n.zoom-leave-to {\n  transform: scale(1.05);\n  opacity: 0;\n}\n', 0, '2025-08-07 10:17:29', '2025-08-07 10:17:29', 0);
INSERT INTO `gen_template` VALUES (278, 30, 'index.scss.ftl', '${frontendPath}/src/styles/index.scss', 'css初始化文件', '@import \'./variables.scss\';\n@import \'./layout.scss\';\n@import \'./element.scss\';\n', 0, '2025-08-07 10:18:01', '2025-08-07 10:18:01', 0);
INSERT INTO `gen_template` VALUES (279, 30, 'element.scss.ftl', '${frontendPath}/src/styles/element.scss', 'element组件css文件', '// cover some element-plus styles\n\n.el-menu {\n  border-right: none !important;\n  &:not(.el-menu--collapse) {\n    width: var(--theme-aside-width);\n  }\n}\n\n.el-menu-item,\n.el-sub-menu__title {\n  color: var(--theme-menu-text-color) !important;\n  height: 48px !important;\n  overflow: hidden;\n}\n\n.el-menu.el-menu--horizontal {\n  border-bottom: none !important;\n}\n\n.el-menu-item {\n  height: 45px !important;\n  line-height: 45px !important;\n}\n\n.el-menu-item a,\n.el-menu-item a:hover,\n.el-menu-item i,\n.el-sub-menu__title i {\n  color: inherit;\n  text-decoration: none;\n}\n\n.el-menu-item .svg-icon,\n.el-sub-menu .svg-icon {\n  font-size: 16px !important;\n  display: inline-block;\n  vertical-align: middle;\n  margin-right: 5px;\n  width: 24px;\n  text-align: center;\n}\n\n.el-sub-menu.is-active > :first-child {\n  overflow: hidden;\n  color: var(--theme-menu-hover-color) !important;\n}\n\n.el-menu-item.is-active{\n  border-right: 2px solid var(--theme-menu-border-color);\n  position: relative;\n  right:1px;\n  overflow: hidden;\n  color: var(--theme-menu-hover-color) !important;\n  background-color: var(--theme-menu-hover-bg-color) !important;\n  &:hover{\n    background-color: var(--theme-menu-hover-bg-color) !important;\n  }\n}\n\n.el-sub-menu.is-active.is-opened {\n  .el-sub-menu__title {\n    background-color: unset !important;\n    color: var(--theme-menu-hover-color);\n  }\n}\n\n// 鼠标 hover 时\n.el-menu-item:hover,\n.el-sub-menu__title:hover {\n  background-color: unset !important;\n  color: var(--theme-menu-hover-color) !important;\n}\n\n.el-pagination{\n  margin-top: 15px;\n  justify-content: flex-end;\n}\n\n.el-form--inline .el-form-item{\n  margin-right: 16px !important;\n}\n\n.el-drawer .el-drawer__header {\n  display: flex;\n  align-items: center;\n  height: 60px;\n  padding: 0 15px;\n  margin-bottom: 0 !important;\n  font-size: 15px;\n  border-bottom: 1px solid var(--el-border-color);\n  color: var(--el-text-color-primary);\n}\n.el-card.is-always-shadow{\n  box-shadow: none !important;\n}\n', 0, '2025-08-07 10:18:41', '2025-08-07 10:18:41', 0);
INSERT INTO `gen_template` VALUES (280, 30, 'user-store.ts.ftl', '${frontendPath}/src/store/user-store.ts', '用户store文件', 'import { defineStore } from \'pinia\'\nimport { reactive, ref } from \'vue\'\n\nexport interface UserInfo {\n	username: string\n\n	nickname: string\n\n	avatar: string\n\n	email: string\n\n	mobile: string\n}\n\nexport interface TokenInfo {\n	// 访问令牌\n	accessToken: string\n	// 刷新令牌\n	refreshToken: string\n	// 过期时间\n	expire: number\n}\n\nexport interface MenuInfo {\n	// 路径\n	path: string\n	// 名称\n	name: string\n	// 组件路径\n	component?: string\n	// 元数据\n	meta: {\n		// 标题\n		title: string\n		// 图标\n		icon: string\n		// 缓存\n		cache: boolean\n		// 类型 0-目录、1-菜单、2-按钮\n		type: number\n		// 隐藏\n		hidden: boolean\n	}\n	// 子菜单\n	children?: MenuInfo[]\n}\n\nconst INITIAL_USER_INFO: UserInfo = {\n	username: \'\',\n	nickname: \'\',\n	avatar: \'\',\n	email: \'\',\n	mobile: \'\'\n}\n\nconst INITIAL_TOKEN_INFO: TokenInfo = {\n	accessToken: \'\',\n	refreshToken: \'\',\n	expire: 0\n}\n\nexport const menuRoutes: MenuInfo[] = [\n  <#list tableModelList as tableModel>\n    {\n        path: \'/${tableModel.functionNameKebabCase}\',\n        component: \'${tableModel.functionNameKebabCase}/index\',\n        name: \'${tableModel.functionNamePascal}\',\n        meta: {\n            title: \'${tableModel.tableComment}管理\',\n            icon: \'icon-icon-test\',\n            cache: true,\n            type: 1,\n            hidden: false\n        }\n    }<#if tableModel_has_next>,</#if>\n</#list>\n]\n\nexport const useUserStore = defineStore(\n	\'user\',\n	() => {\n		// 状态\n		// 是否登录\n		const isLogin = ref(false)\n		// 是否添加路由\n		const isAddRoutes = ref(false)\n		// 菜单列表\n		const menuList = ref<MenuInfo[]>([...menuRoutes])\n		// 权限列表\n		const permissionList = ref<string[]>([])\n		// 登录用户信息\n		// 这里必须使用解构的方式，不然一直使用一个对象\n		// reactive每次初始化，必须传入一个全新的对象\n		const userInfo = reactive<UserInfo>({ ...INITIAL_USER_INFO })\n		// token信息\n		const tokenInfo = reactive<TokenInfo>({ ...INITIAL_TOKEN_INFO })\n\n		// 计算属性\n\n		// actions\n		// 设置添加路由的标志\n		const setAddRouteFlag = () => {\n			isAddRoutes.value = true\n		}\n\n		// 清空数据\n		const clearAll = () => {\n			menuList.value = []\n			permissionList.value = []\n			// 完全清空 userInfo\n			Object.assign(userInfo, INITIAL_USER_INFO)\n\n			// 完全清空 tokenInfo\n			Object.assign(tokenInfo, INITIAL_TOKEN_INFO)\n			isLogin.value = false\n		}\n\n		// 设置登录后的数据\n		const setData = (loginVO: any) => {\n			Object.assign(userInfo, loginVO.userInfo)\n			Object.assign(tokenInfo, loginVO.tokenInfo)\n			menuList.value = loginVO.menuList\n			permissionList.value = loginVO.permissionList\n			isLogin.value = true\n		}\n\n		return {\n			isLogin,\n			isAddRoutes,\n			menuList,\n			permissionList,\n			userInfo,\n			tokenInfo,\n			clearAll,\n			setData,\n			setAddRouteFlag\n		}\n	},\n	{\n		persist: {\n			key: \'userStore\',\n			omit: [\'isAddRoutes\'],\n			storage: localStorage\n		}\n	}\n)\n', 0, '2025-08-07 10:19:30', '2025-08-07 15:31:01', 0);
INSERT INTO `gen_template` VALUES (281, 30, 'app-store.ts.ftl', '${frontendPath}/src/store/app-store.ts', '应用store文件', 'import { defineStore } from \'pinia\'\nimport { ref, computed } from \'vue\'\nimport { RouteMetaData } from \'@/utils/router-guard\'\nimport { router } from \'@/router\'\n\n// 标签数据\nexport interface NavbarTag {\n	// 完整路径\n	fullPath: string\n	// 组件名称\n	name: string\n	// 标题\n	title: string\n	// 图标\n	icon: string\n}\n\n// 面包屑\nexport interface Breadcrumb {\n	// 标题\n	title: string\n	// 图标\n	icon: string\n}\n\nexport const useAppStore = defineStore(\n	\'app\',\n	() => {\n		// 状态\n		// 折叠状态\n		const isCollapseRef = ref(false)\n		// 标签列表\n		const tagsListRef = ref<NavbarTag[]>([])\n		// 面包屑列表\n		const breadcrumbListRef = ref<Breadcrumb[]>([])\n		// 缓存组件列表\n		const cacheListRef = ref<string[]>([])\n\n		// 计算属性\n		// 标签数量\n		const tagLength = computed(() => tagsListRef.value.length)\n\n		// 缓存组件列表\n\n		// actions\n		// 切换折叠状态\n		const toggleCollapse = () => {\n			isCollapseRef.value = !isCollapseRef.value\n		}\n\n		// 设置面包屑\n		const setBreadcrumb = (routeMetaData: RouteMetaData) => {\n			const matched: Breadcrumb[] = []\n			const paths = routeMetaData.path.split(\'/\').filter((p: any) => p)\n\n			let currentPath = \'\'\n			for (const path of paths) {\n				currentPath += `/<#noparse>${path}</#noparse>`\n				const breadcrumb = findRouteByPath(currentPath)\n				if (breadcrumb && breadcrumb.title && breadcrumb.icon) {\n					matched.push(breadcrumb)\n				}\n			}\n			breadcrumbListRef.value = matched\n		}\n\n		// 添加标签\n		const addTag = (tag: NavbarTag) => {\n			const isExist = tagsListRef.value.find(item => item.fullPath === tag.fullPath)\n			const includes = tag.fullPath.includes(\'redirect\')\n			if (!isExist && !includes) {\n				tagsListRef.value.push(tag)\n			}\n		}\n\n		// 删除标签\n		const removeTag = (tag: NavbarTag) => {\n			tagsListRef.value = tagsListRef.value.filter(item => item.fullPath !== tag.fullPath)\n		}\n\n		// 添加所有标签\n		const addAllTags = (tagList: NavbarTag[]) => {\n			tagsListRef.value = tagList\n		}\n\n		// 删除所有标签\n		const removeAllTags = () => {\n			tagsListRef.value = []\n		}\n\n		// 添加缓存路由\n		const addCacheComponent = (name: string) => {\n			if (!cacheListRef.value.includes(name)) {\n				cacheListRef.value.push(name)\n			}\n		}\n\n		// 删除缓存路由\n		const removeCacheComponent = (name: string) => {\n			cacheListRef.value.splice(cacheListRef.value.indexOf(name), 1)\n		}\n\n		// 批量删除缓存路由\n		const removeCacheComponentList = (nameList: string[]) => {\n			if (!nameList || nameList.length === 0) {\n				return\n			}\n			for (const name of nameList) {\n				cacheListRef.value.splice(cacheListRef.value.indexOf(name), 1)\n			}\n		}\n\n		// 删除所有缓存\n		const removeAllCache = () => {\n			cacheListRef.value = []\n		}\n\n		return {\n			isCollapseRef,\n			breadcrumbListRef,\n			tagsListRef,\n			cacheListRef,\n			tagLength,\n			toggleCollapse,\n			setBreadcrumb,\n			addTag,\n			removeTag,\n			addAllTags,\n			removeAllTags,\n			addCacheComponent,\n			removeCacheComponent,\n			removeCacheComponentList,\n			removeAllCache\n		}\n	},\n	{\n		persist: {\n			key: \'appStore\',\n			storage: localStorage\n		}\n	}\n)\n\n/**\n * 查找路径对应的 meta.title\n */\nconst findRouteByPath = (targetPath: string): Breadcrumb => {\n	// 使用 Vue Router 的路径匹配算法\n	const matchedRoute = router.resolve(targetPath)\n\n	if (matchedRoute?.meta?.title) {\n		return {\n			title: matchedRoute.meta.title as string,\n			icon: matchedRoute.meta.icon as string\n		}\n	} else {\n		return { title: \'\', icon: \'\' }\n	}\n}\n', 0, '2025-08-07 10:20:05', '2025-08-07 11:01:39', 0);
INSERT INTO `gen_template` VALUES (282, 30, 'router.ts.ftl', '${frontendPath}/src/router/index.ts', '全局路由文件', 'import { createRouter, createWebHashHistory, RouteRecordRaw } from \'vue-router\'\nimport { routerGuard } from \'@/utils/router-guard\'\n\n// 常量路由\nexport const constantRoutes: RouteRecordRaw[] = [\n	{\n		path: \'/\',\n		name: \'Layout\',\n		component: () => import(\'@/layout/index.vue\'),\n		redirect: \'/index\',\n		children: []\n	},\n	{\n		path: \'/index\',\n		component: () => import(\'@/views/index/index.vue\'),\n		name: \'Index\',\n		meta: {\n			title: \'首页\',\n			icon: \'icon-dashboard-fill\',\n			cache: true,\n			type: 1,\n			hidden: false\n		}\n	},\n	{\n		path: \'/icon-search\',\n		component: () => import(\'@/views/icon-search/index.vue\'),\n		name: \'IconSearch\',\n		meta: {\n			title: \'图标搜索\',\n			icon: \'icon-icon-test\',\n			cache: true,\n			type: 1,\n			hidden: false\n		}\n	},\n	{\n		path: \'/redirect\',\n		name: \'Redirect\',\n		component: () => import(\'@/layout/index.vue\'),\n		children: [\n			{\n				path: \'/redirect/:path(.*)\',\n				component: () => import(\'@/views/router/redirect.vue\'),\n				meta: {\n					title: \'重定向\',\n					cache: false\n				}\n			}\n		]\n	},\n	{\n		path: \'/:pathMatch(.*)\',\n		component: () => import(\'@/views/404.vue\')\n	}\n]\n\nexport const router = createRouter({\n	history: createWebHashHistory(),\n	scrollBehavior(_to, _from, savedPosition) {\n		if (savedPosition) {\n			return savedPosition\n		} else {\n			return { top: 0 }\n		}\n	},\n	routes: constantRoutes\n})\n\n// 路由拦截\nrouterGuard(router)\n', 0, '2025-08-07 10:20:42', '2025-08-07 15:53:07', 0);
INSERT INTO `gen_template` VALUES (283, 30, '404.vue.ftl', '${frontendPath}/src/views/404.vue', '404页面', '<template>\n	<div class=\"layout-error\">\n		<img src=\"@/assets/404.png\" alt=\"404\" />\n		<div>\n			<el-button type=\"primary\" @click=\"onBack\">返回</el-button>\n			<el-button type=\"success\" @click=\"onToHome\">主页</el-button>\n		</div>\n	</div>\n</template>\n\n<script setup lang=\"ts\">\nimport { useRouter } from \'vue-router\'\n\nconst router = useRouter()\n\nconst onBack = () => {\n	router.back()\n}\nconst onToHome = () => {\n	router.replace(\'/\')\n}\n</script>\n\n<style lang=\"scss\" scoped>\n.layout-error {\n	img {\n		width: 800px;\n	}\n	display: flex;\n	flex-direction: column;\n	align-items: center;\n}\n</style>\n', 0, '2025-08-07 10:21:16', '2025-08-07 10:21:16', 0);
INSERT INTO `gen_template` VALUES (284, 30, 'redirect.vue.ftl', '${frontendPath}/src/views/router/redirect.vue', '重定向页面', '<template>\n	<div></div>\n</template>\n\n<script setup lang=\"ts\">\nimport { useRoute, useRouter } from \'vue-router\'\n\nconst route = useRoute()\nconst router = useRouter()\nconst { params, query } = route\nconst { path } = params\n\ndefineOptions({\n	name: \'Redirect\'\n})\nrouter.replace({ path: \'/\' + path, query })\n</script>\n', 0, '2025-08-07 10:21:45', '2025-08-07 10:21:45', 0);
INSERT INTO `gen_template` VALUES (285, 30, 'index.vue.ftl', '${frontendPath}/src/views/index/index.vue', '首页页面', '<template>\n	<h1>首页</h1>\n</template>\n\n<script setup lang=\"ts\">\n</script>\n<style scoped></style>\n', 0, '2025-08-07 10:22:17', '2025-08-07 10:22:17', 0);
INSERT INTO `gen_template` VALUES (286, 30, 'layout-index.vue.ftl', '${frontendPath}/src/layout/index.vue', '布局首页页面', '<template>\n	<el-container class=\"layout-container\">\n		<el-aside class=\"layout-sidebar\" :style=\"{ width: appStore.isCollapseRef ? \'64px\' : \'200px\' }\">\n			<sidebar></sidebar>\n		</el-aside>\n		<el-container direction=\"vertical\">\n			<el-header class=\"layout-header\">\n				<navbar></navbar>\n			</el-header>\n			<el-main class=\"layout-main\">\n				<el-scrollbar class=\"layout-scrollbar\">\n					<div class=\"layout-card\">\n						<router-view v-slot=\"{ Component, route }\">\n							<transition name=\"slide\" mode=\"out-in\">\n								<keep-alive :include=\"appStore.cacheListRef\" :exclude=\"[\'Redirect\']\">\n									<component :is=\"Component\" :key=\"route.fullPath\"></component>\n								</keep-alive>\n							</transition>\n						</router-view>\n					</div>\n				</el-scrollbar>\n			</el-main>\n		</el-container>\n	</el-container>\n</template>\n\n<script setup lang=\"ts\">\nimport sidebar from \'@/layout/sidebar/index.vue\'\nimport navbar from \'@/layout/navbar/index.vue\'\nimport { useAppStore } from \'@/store/app-store\'\n\nconst appStore = useAppStore()\n</script>\n\n<style scoped></style>\n', 0, '2025-08-07 10:23:05', '2025-08-07 17:14:18', 0);
INSERT INTO `gen_template` VALUES (287, 30, 'layout-navbar-index.vue.ftl', '${frontendPath}/src/layout/navbar/index.vue', '布局顶栏页面', '<template>\n	<div>\n		<div class=\"navbar-container\">\n			<!-- 左侧区域：折叠按钮 + 面包屑 -->\n			<div class=\"navbar-left\">\n				<el-icon :size=\"18\" class=\"collapse-icon\" @click=\"appStore.toggleCollapse()\">\n					<Expand v-if=\"appStore.isCollapseRef\"></Expand>\n					<Fold v-else></Fold>\n				</el-icon>\n				<breadcrumb></breadcrumb>\n			</div>\n\n			<!-- 右侧区域：搜索 + 刷新 + 链接 + 全屏按钮 -->\n			<div class=\"navbar-right\">\n				<menu-search></menu-search>\n				<refresh-current-page></refresh-current-page>\n				<el-tooltip :content=\"isFullscreen ? \'退出全屏\' : \'全屏\'\" effect=\"dark\" placement=\"bottom\">\n					<el-icon :size=\"18\" class=\"collapse-icon\" @click=\"toggle()\">\n						<FullScreen v-if=\"!isFullscreen\" />\n						<Aim v-else />\n					</el-icon>\n				</el-tooltip>\n			</div>\n		</div>\n		<!-- 标签栏 -->\n		<tag></tag>\n	</div>\n</template>\n\n<script setup lang=\"ts\">\nimport { Aim, Expand, Fold, FullScreen } from \'@element-plus/icons-vue\'\nimport { useAppStore } from \'@/store/app-store\'\nimport Tag from \'@/layout/navbar/components/tag.vue\'\nimport Breadcrumb from \'@/layout/navbar/components/breadcrumb.vue\'\nimport MenuSearch from \'@/layout/navbar/components/menu-search.vue\'\nimport RefreshCurrentPage from \'@/layout/navbar/components/refresh-current-page.vue\'\nimport SvgIcon from \'@/components/svg-icon/index.vue\'\nimport { useFullscreen } from \'@vueuse/core\'\n\nconst { isFullscreen, toggle } = useFullscreen()\nconst appStore = useAppStore()\n</script>\n\n<style scoped>\n.navbar-container {\n	display: flex;\n	justify-content: space-between;\n	align-items: center;\n	margin-top: 10px;\n	margin-bottom: 10px;\n}\n\n.navbar-left {\n	display: flex;\n	align-items: center;\n	gap: 16px;\n}\n\n.navbar-right {\n	display: flex;\n	align-items: center;\n	gap: 16px;\n	margin-left: auto;\n	margin-right: 40px;\n}\n\n.collapse-icon {\n	cursor: pointer;\n}\n</style>\n', 0, '2025-08-07 10:23:48', '2025-08-07 17:14:47', 0);
INSERT INTO `gen_template` VALUES (288, 30, 'breadcrumb.vue.ftl', '${frontendPath}/src/layout/navbar/components/breadcrumb.vue', '面包屑页面', '<template>\n	<el-breadcrumb separator=\"/\">\n		<el-breadcrumb-item v-for=\"item in appStore.breadcrumbListRef\" :key=\"item.title\">\n			<template #default>\n				<span style=\"display: inline-flex; align-items: center; gap: 5px\">\n					<svg-icon :icon=\"item.icon\"></svg-icon>\n					{{ item.title }}\n				</span>\n			</template>\n		</el-breadcrumb-item>\n	</el-breadcrumb>\n</template>\n\n<script setup lang=\"ts\">\nimport SvgIcon from \'@/components/svg-icon/index.vue\'\nimport { useAppStore } from \'@/store/app-store\'\n\nconst appStore = useAppStore()\n</script>\n', 0, '2025-08-07 10:24:19', '2025-08-07 10:27:27', 0);
INSERT INTO `gen_template` VALUES (289, 30, 'menu-search.vue.ftl', '${frontendPath}/src/layout/navbar/components/menu-search.vue', '菜单搜索页面', '<template>\n	<!-- 搜索框 -->\n	<div class=\"search-container\">\n		<el-tooltip :content=\"\'菜单搜索\'\" effect=\"dark\" placement=\"bottom\">\n			<el-icon :size=\"18\" class=\"search-icon\" @click=\"openSearch\">\n				<Search></Search>\n			</el-icon>\n		</el-tooltip>\n		<el-dialog v-model=\"searchState.visible\" placement=\"bottom\" trigger=\"click\" title=\"菜单搜索\" class=\"menu-search-dialog\" @opened=\"onDialogOpened\">\n			<el-input\n				ref=\"searchInputRef\"\n				v-model=\"searchState.keyword\"\n				placeholder=\"请输入菜单名称\"\n				clearable\n				:prefix-icon=\"Search\"\n				class=\"search-input\"\n				@input=\"querySearch\"\n				@keydown.up.prevent=\"handleKeyUp\"\n				@keydown.down.prevent=\"handleKeyDown\"\n				@keydown.enter=\"handleKeyEnter\"\n			></el-input>\n\n			<!-- 包裹层用于键盘模式下控制 hover 样式 -->\n			<el-scrollbar max-height=\"300px\" class=\"search-results\" :class=\"{ \'using-keyboard\': searchState.usingKeyboard }\">\n				<el-row\n					v-for=\"(item, index) in searchState.matchItemList\"\n					:key=\"item.path\"\n					class=\"menu-item\"\n					:class=\"{ active: index === searchState.activeIndex }\"\n					@click=\"handleSelect(item)\"\n					@mouseenter=\"handleMouseEnter(index)\"\n				>\n					<!-- 面包屑风格展示路径 -->\n					<span v-for=\"(breadcrumbItem, breadcrumbIndex) in item.breadcrumbItemList\" :key=\"breadcrumbItem.title\" class=\"breadcrumb-item\">\n						<svg-icon :icon=\"breadcrumbItem.icon\"></svg-icon>\n						<el-text>{{ breadcrumbItem.title }}</el-text>\n						<el-text v-if=\"breadcrumbIndex < item.breadcrumbItemList.length - 1\">/</el-text>\n					</span>\n				</el-row>\n				<div v-if=\"searchState.matchItemList.length === 0\" class=\"no-results\">\n					<el-text>无匹配结果</el-text>\n				</div>\n			</el-scrollbar>\n\n			<!-- 底部快捷提示栏 -->\n			<div class=\"shortcut-bar\">\n				<div class=\"icon-text\">\n					<svg-icon icon=\"icon-enter\" class=\"icon-button\"></svg-icon>\n					<el-text class=\"hint-text\">确认</el-text>\n				</div>\n				<div class=\"icon-text\">\n					<svg-icon icon=\"icon-arrowup\" class=\"icon-button small-arrow\"></svg-icon>\n					<svg-icon icon=\"icon-arrowdown\" class=\"icon-button small-arrow\"></svg-icon>\n					<el-text class=\"hint-text\">切换</el-text>\n				</div>\n				<div class=\"icon-text\">\n					<el-text class=\"esc-box\">ESC</el-text>\n					<el-text class=\"hint-text\">关闭</el-text>\n				</div>\n			</div>\n		</el-dialog>\n	</div>\n</template>\n\n<script setup lang=\"ts\">\nimport { Search } from \'@element-plus/icons-vue\'\nimport SvgIcon from \'@/components/svg-icon/index.vue\'\nimport { nextTick, reactive, ref } from \'vue\'\nimport { MenuInfo, useUserStore } from \'@/store/user-store\'\nimport { useRouter } from \'vue-router\'\n\ndefineOptions({\n	name: \'MenuSearch\'\n})\n\ninterface BreadcrumbItem {\n	title: string\n	icon: string\n}\n\ninterface SearchItem extends MenuInfo {\n	breadcrumbItemList: BreadcrumbItem[]\n}\n\nconst searchState = reactive({\n	visible: false,\n	keyword: \'\',\n	searchItemList: [] as SearchItem[],\n	matchItemList: [] as SearchItem[],\n	activeIndex: -1,\n	usingKeyboard: false // 标记是否正在使用键盘控制\n})\n\nconst searchInputRef = ref()\nconst userStore = useUserStore()\nconst router = useRouter()\n\n// 打开搜索框\nconst openSearch = () => {\n	searchState.visible = true\n	searchState.keyword = \'\'\n	searchState.activeIndex = -1\n	searchState.usingKeyboard = false\n\n	// 将 userStore.menuList 进行平铺展开\n	searchState.searchItemList = []\n	userStore.menuList.forEach(menuItem => {\n		buildMenuInfo([], menuItem)\n	})\n\n	querySearch(\'\')\n}\n\nconst onDialogOpened = () => {\n	nextTick(() => {\n		searchInputRef.value?.focus()\n	})\n}\n\nconst buildMenuInfo = (parentBreadcrumb: BreadcrumbItem[], menuItem: MenuInfo) => {\n	if (menuItem.meta.type === 2) {\n		return\n	}\n	if (menuItem.meta.hidden) {\n		return\n	}\n\n	const currentBreadcrumb = [\n		...parentBreadcrumb,\n		{\n			title: menuItem.meta.title,\n			icon: menuItem.meta.icon\n		} as BreadcrumbItem\n	]\n\n	if (menuItem.meta.type === 1) {\n		const newMenuItem = {\n			...menuItem,\n			meta: { ...menuItem.meta },\n			breadcrumbItemList: currentBreadcrumb\n		}\n		searchState.searchItemList.push(newMenuItem)\n		return\n	}\n\n	if (menuItem.children && menuItem.children.length > 0) {\n		menuItem.children.forEach(child => {\n			buildMenuInfo(currentBreadcrumb, child)\n		})\n	}\n}\n\n// 处理搜索建议\nconst querySearch = (queryString?: string) => {\n	const raw = queryString !== undefined ? queryString : searchState.keyword\n	if (!raw || !raw.trim()) {\n		searchState.matchItemList = searchState.searchItemList\n		searchState.activeIndex = -1\n		searchState.usingKeyboard = false\n		return\n	}\n\n	const keyword = raw.toLowerCase()\n	const results: SearchItem[] = []\n\n	searchState.searchItemList.forEach(menu => {\n		const breadcrumbText = menu.breadcrumbItemList\n			.flatMap(item => item.title)\n			.join(\'/\')\n			.toLowerCase()\n		if (breadcrumbText.includes(keyword)) {\n			results.push(menu)\n		}\n	})\n	searchState.matchItemList = results\n	searchState.activeIndex = results.length > 0 ? 0 : -1\n	searchState.usingKeyboard = false // 重新搜索时重置键盘状态\n}\n\n// 处理鼠标进入事件\nconst handleMouseEnter = (index: number) => {\n	searchState.activeIndex = index\n	searchState.usingKeyboard = false\n}\n\n// 处理向上键\nconst handleKeyUp = () => {\n	if (searchState.matchItemList.length === 0) {\n		return\n	}\n	searchState.usingKeyboard = true\n\n	if (searchState.activeIndex === -1) {\n		searchState.activeIndex = searchState.matchItemList.length - 1\n	} else if (searchState.activeIndex === 0) {\n		searchState.activeIndex = searchState.matchItemList.length - 1\n	} else {\n		searchState.activeIndex--\n	}\n}\n\n// 处理向下键\nconst handleKeyDown = () => {\n	if (searchState.matchItemList.length === 0) {\n		return\n	}\n	searchState.usingKeyboard = true\n\n	if (searchState.activeIndex === -1) {\n		searchState.activeIndex = 0\n	} else if (searchState.activeIndex === searchState.matchItemList.length - 1) {\n		searchState.activeIndex = 0\n	} else {\n		searchState.activeIndex++\n	}\n}\n\n// 处理回车键\nconst handleKeyEnter = () => {\n	if (searchState.activeIndex >= 0 && searchState.matchItemList.length > 0) {\n		handleSelect(searchState.matchItemList[searchState.activeIndex])\n	}\n}\n\n// 选择搜索结果\nconst handleSelect = (item: any) => {\n	searchState.visible = false\n	searchState.keyword = \'\'\n	searchState.activeIndex = -1\n	searchState.usingKeyboard = false\n	router.push(item.path)\n}\n</script>\n\n<style scoped>\n.search-container {\n	display: flex;\n	align-items: center;\n}\n\n.search-icon {\n	cursor: pointer;\n}\n\n.search-results {\n	margin-top: 8px;\n	overflow-y: auto;\n}\n\n/* 禁用键盘模式下非激活项的 hover 高亮 */\n.search-results.using-keyboard .menu-item:not(.active):hover {\n	background-color: transparent;\n	color: inherit;\n	transform: none;\n	box-shadow: none;\n}\n.search-results.using-keyboard .menu-item:not(.active)::before {\n	left: -100%;\n	transition: none;\n}\n\n.menu-item {\n	display: flex;\n	align-items: center;\n	gap: 10px;\n	margin: 3px 0;\n	padding: 8px 12px;\n	cursor: pointer;\n	border-radius: 4px;\n	transition: all 0.2s ease;\n	position: relative;\n	overflow: hidden;\n	font-size: 13px;\n}\n\n/* 激活 / hover 的样式保持清爽不过于夸张 */\n.menu-item:hover,\n.menu-item.active {\n	background-color: #409eff;\n	color: white;\n	transform: none;\n	box-shadow: none;\n}\n\n/* 高亮滑动效果保持轻微 */\n.menu-item::before {\n	content: \'\';\n	position: absolute;\n	top: 0;\n	left: -100%;\n	width: 100%;\n	height: 100%;\n	background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.15), transparent);\n	transition: left 0.4s;\n}\n\n.menu-item:hover::before,\n.menu-item.active::before {\n	left: 100%;\n}\n\n.breadcrumb-item {\n	display: inline-flex;\n	align-items: center;\n	gap: 4px;\n	font-size: 13px;\n}\n\n.icon-text {\n	display: flex;\n	align-items: center;\n	gap: 6px;\n	font-size: 12px;\n}\n\n.icon-button {\n	border: 1px solid #dcdfe6;\n	border-radius: 4px;\n	padding: 4px 6px;\n	box-shadow: none;\n	background: #f5f7fa;\n	display: inline-flex;\n	align-items: center;\n	font-size: 12px;\n	line-height: 1;\n}\n\n/* 箭头用稍小一点以避免过重 */\n.small-arrow {\n	padding: 2px 5px;\n}\n\n/* ESC 框样式更接近文字按钮 */\n.esc-box {\n	display: inline-block;\n	border: 1px solid #dcdfe6;\n	border-radius: 4px;\n	padding: 4px 8px;\n	background: #f5f7fa;\n	font-size: 12px;\n	line-height: 1;\n}\n\n/* 底部快捷提示栏样式，贴合截图的白底、无阴影、紧凑布局 */\n.shortcut-bar {\n	display: flex;\n	gap: 20px;\n	margin: 10px 0 0;\n	padding: 8px 12px;\n	background: #ffffff;\n	border-top: 1px solid #e6e6e6;\n	font-size: 12px;\n	align-items: center;\n}\n\n/* 搜索输入稍微压紧 */\n.search-input {\n	margin-bottom: 6px;\n}\n\n/* 无结果文案居中 */\n.no-results {\n	padding: 16px 0;\n	text-align: center;\n	color: #8c8c8c;\n}\n</style>\n', 0, '2025-08-07 10:25:01', '2025-08-07 10:27:43', 0);
INSERT INTO `gen_template` VALUES (290, 30, 'refresh-current-page.vue.ftl', '${frontendPath}/src/layout/navbar/components/refresh-current-page.vue', '刷新当前页页面', '<template>\n	<div class=\"refresh-container\">\n		<el-tooltip :content=\"\'刷新页面\'\" effect=\"dark\" placement=\"bottom\">\n			<el-icon :size=\"18\" class=\"refresh-icon\" @click=\"refreshHandler()\">\n				<Refresh></Refresh>\n			</el-icon>\n		</el-tooltip>\n	</div>\n</template>\n<script setup lang=\"ts\">\nimport { Refresh } from \'@element-plus/icons-vue\'\nimport { useRoute, useRouter } from \'vue-router\'\nimport { useAppStore } from \'@/store/app-store\'\n\nconst route = useRoute()\nconst router = useRouter()\nconst appStore = useAppStore()\n\ndefineOptions({\n	name: \'RefreshCurrentPage\'\n})\n\nconst refreshHandler = () => {\n	const resolve = router.resolve(route.path)\n	if (resolve && resolve.name) {\n		// 删除缓存组件\n		appStore.removeCacheComponent(resolve.name as string)\n	}\n	// 使用路由跳转实现刷新\n	router.push({\n		path: \'/redirect\' + route.fullPath,\n		query: route.query\n	})\n}\n</script>\n<style scoped>\n.refresh-icon {\n	cursor: pointer;\n}\n.refresh-container {\n	display: flex;\n	align-items: center;\n}\n</style>\n', 0, '2025-08-07 10:25:29', '2025-08-07 10:27:59', 0);
INSERT INTO `gen_template` VALUES (291, 30, 'tag.vue.ftl', '${frontendPath}/src/layout/navbar/components/tag.vue', '标签页页面', '<template>\n	<!-- 防止tag过多添加滚动条 -->\n	<el-scrollbar class=\"tag-scrollbar\">\n		<div class=\"tag-wrapper\">\n			<!-- 标签栏 -->\n			<el-tag\n				v-for=\"(tag, index) in appStore.tagsListRef\"\n				:key=\"tag.fullPath\"\n				size=\"default\"\n				:effect=\"tag.fullPath === route.fullPath ? \'dark\' : \'plain\'\"\n				:closable=\"tag.fullPath != \'/index\' || appStore.tagLength > 1\"\n				@click=\"handleClick(index, tag)\"\n				@close=\"handleClose(index, tag)\"\n				@contextmenu.prevent=\"showTagMenu($event, tag, index)\"\n			>\n				<template #default>\n					<span style=\"display: inline-flex; align-items: center; gap: 5px\">\n						<svg-icon :icon=\"tag.icon\"></svg-icon>\n						{{ tag.title }}\n					</span>\n				</template>\n			</el-tag>\n\n			<!-- 右键菜单 -->\n			<div v-if=\"tagMenuVisible\" class=\"tag-context-menu\" :style=\"menuPosition\">\n				<tag-menu\n					:current-menu-tag=\"currentMenuTag\"\n					:current-menu-tag-index=\"currentMenuTagIndex\"\n					@close-current-tag=\"closeCurrentTag()\"\n					@refresh-current-tag=\"refreshCurrentTag()\"\n					@close-other-tags=\"closeOtherTags()\"\n					@close-left-tag=\"closeLeftTag()\"\n					@close-right-tag=\"closeRightTag()\"\n					@close-all-tags=\"closeAllTags()\"\n				></tag-menu>\n			</div>\n		</div>\n	</el-scrollbar>\n</template>\n\n<script setup lang=\"ts\">\nimport { useAppStore, NavbarTag } from \'@/store/app-store\'\nimport { useRoute, useRouter } from \'vue-router\'\nimport { onMounted, ref, onUnmounted, Ref, nextTick } from \'vue\'\nimport TagMenu from \'@/layout/navbar/components/tag-menu.vue\'\nimport SvgIcon from \'@/components/svg-icon/index.vue\'\nimport Sortable from \'sortablejs\'\n\nconst route = useRoute()\nconst router = useRouter()\nconst tagMenuVisible = ref(false)\nconst menuPosition = ref({\n	left: \'0px\',\n	top: \'0px\'\n})\nconst currentMenuTag = ref<NavbarTag>({ fullPath: \'/index\', title: \'首页\', icon: \'icon-home\', name: \'Index\' })\nconst currentMenuTagIndex: Ref<number> = ref(0)\nconst appStore = useAppStore()\n\nonMounted(() => {\n	// 点击页面任意位置关闭右键菜单\n	document.addEventListener(\'click\', closeTagMenu)\n})\n\n// 实现标签页的拖拽效果\nonMounted(() => {\n	nextTick(() => {\n		const el = document.querySelector(\'.tag-wrapper\') as HTMLElement\n		if (el) {\n			new Sortable(el, {\n				animation: 200,\n				scroll: true,\n				scrollSensitivity: 30,\n				scrollSpeed: 100,\n				onEnd: evt => {\n					const { oldIndex, newIndex } = evt\n					if (oldIndex !== null && newIndex !== null && oldIndex !== newIndex) {\n						const newTags = [...appStore.tagsListRef]\n						const movedTag = newTags.splice(oldIndex!, 1)[0]\n						newTags.splice(newIndex!, 0, movedTag)\n						appStore.addAllTags(newTags)\n					}\n				}\n			})\n		} else {\n			console.error(\'未找到.tag-wrapper元素\')\n		}\n	})\n})\n\n// 组件卸载时移除事件监听\nonUnmounted(() => {\n	document.removeEventListener(\'click\', closeTagMenu)\n})\n\nconst handleClick = (_: number, tag: NavbarTag) => {\n	router.push(tag.fullPath)\n}\n\nconst handleClose = (index: number, tag: NavbarTag) => {\n	// 新增：首页保护逻辑（当只有一个标签且是首页时不允许关闭）\n	if (appStore.tagLength === 1 && tag.fullPath === \'/index\') {\n		return // 直接返回，不执行关闭操作\n	}\n\n	// 删除对应的缓存组件\n	appStore.removeCacheComponent(tag.name)\n\n	// 删除标签页\n	appStore.removeTag(tag)\n	// 判断当前标签页是否为当前路由\n	if (tag.fullPath === route.fullPath) {\n		let to = \'/\' // 默认跳转首页\n\n		// 关闭后如果还有标签页\n		if (appStore.tagLength > 0) {\n			// 优先尝试右侧标签\n			if (index < appStore.tagLength) {\n				to = appStore.tagsListRef[index].fullPath\n			} else if (index > 0) {\n				// 右侧无标签时选择左侧\n				to = appStore.tagsListRef[index - 1].fullPath\n			}\n		}\n		if (to === \'/\') {\n			router.push({\n				path: \'/redirect/\'\n			})\n		} else {\n			// 跳转当前标签页\n			router.push(to)\n		}\n	}\n}\n\n// 显示标签右键菜单\nconst showTagMenu = (e: MouseEvent, tag: NavbarTag, index: number) => {\n	e.preventDefault()\n	currentMenuTag.value = tag\n	currentMenuTagIndex.value = index\n\n	const x = e.clientX\n	const y = e.clientY\n\n	const menuWidth = 80\n	const menuHeight = 200\n	const windowWidth = window.innerWidth\n	const windowHeight = window.innerHeight\n\n	menuPosition.value = {\n		left: `<#noparse>${Math.min(x, windowWidth - menuWidth)}</#noparse>px`,\n		top: `<#noparse>${Math.min(y, windowHeight - menuHeight)}</#noparse>px`\n	}\n\n	tagMenuVisible.value = true\n}\n\n// 关闭标签菜单\nconst closeTagMenu = () => {\n	tagMenuVisible.value = false\n}\n\n// 刷新当前标签页\nconst refreshCurrentTag = () => {\n	// 删除缓存组件\n	appStore.removeCacheComponent(currentMenuTag.value.name)\n	// 使用路由跳转实现刷新\n	router.push({\n		path: \'/redirect\' + currentMenuTag.value.fullPath,\n		query: route.query\n	})\n	closeTagMenu()\n}\n\n// 关闭当前标签\nconst closeCurrentTag = () => {\n	handleClose(currentMenuTagIndex.value, currentMenuTag.value)\n	closeTagMenu()\n}\n\n// 关闭其他标签\nconst closeOtherTags = () => {\n	const currentPath = currentMenuTag.value.fullPath\n	// 删除其他缓存\n	appStore.removeCacheComponentList(appStore.tagsListRef.filter(tag => tag.fullPath !== currentPath).map(tag => tag.name))\n	// 保留当前标签，关闭其他所有标签\n	appStore.addAllTags(appStore.tagsListRef.filter(tag => tag.fullPath === currentPath))\n	router.push(currentPath)\n	closeTagMenu()\n}\n\n// 关闭所有标签\nconst closeAllTags = () => {\n	appStore.removeAllTags()\n	appStore.removeAllCache()\n	closeTagMenu()\n	router.push({\n		path: \'/redirect/\'\n	})\n}\n\n//关闭左侧标签\nconst closeLeftTag = () => {\n	const currentIndex = currentMenuTagIndex.value\n	appStore.removeCacheComponentList(appStore.tagsListRef.filter((_, index) => index < currentIndex).map(tag => tag.name))\n	appStore.addAllTags(appStore.tagsListRef.filter((_, index) => index >= currentIndex))\n	router.push(currentMenuTag.value.fullPath)\n	closeTagMenu()\n}\n\n//关闭右侧标签\nconst closeRightTag = () => {\n	// 保留当前标签及其左侧所有标签，以及首页标签\n	const currentIndex = currentMenuTagIndex.value\n	appStore.removeCacheComponentList(appStore.tagsListRef.filter((_, index) => index > currentIndex).map(tag => tag.name))\n	appStore.addAllTags(appStore.tagsListRef.filter((_, index) => index <= currentIndex))\n	closeTagMenu()\n}\n</script>\n\n<style scoped>\n.tag-scrollbar {\n	/* 确保滚动条容器宽度占满父级并限制高度 */\n	width: 100%;\n	max-height: calc(var(--theme-header-height) - 30px);\n}\n.tag-wrapper {\n	/* 保持原有样式不变 */\n	margin-top: 5px;\n	margin-bottom: 15px;\n	display: inline-flex;\n	align-items: center;\n	gap: 8px;\n	position: relative;\n	white-space: nowrap;\n	padding-right: 20px;\n}\n\n/* 使用深度选择器覆盖 el-tag 的默认样式 */\n:deep(.tag-wrapper .el-tag) {\n	cursor: pointer;\n}\n.tag-context-menu {\n	position: fixed;\n	align-items: center;\n	background: white;\n	border: 1px solid #ddd;\n	z-index: 1000;\n	min-width: 100px;\n}\n</style>\n', 0, '2025-08-07 10:26:33', '2025-08-07 17:19:28', 0);
INSERT INTO `gen_template` VALUES (292, 30, 'tag-menu.vue.ftl', '${frontendPath}/src/layout/navbar/components/tag-menu.vue', '标签菜单页面', '<template>\n	<div class=\"icon-list\">\n		<div v-if=\"props.currentMenuTag.fullPath === route.fullPath\" class=\"icon-item\" @click=\"emits(\'refreshCurrentTag\')\">\n			<el-icon size=\"10\"><Refresh></Refresh></el-icon>\n			<span>刷新页面</span>\n		</div>\n		<div v-if=\"props.currentMenuTag.fullPath != \'/index\' || appStore.tagLength > 1\" class=\"icon-item\" @click=\"emits(\'closeCurrentTag\')\">\n			<el-icon size=\"10\"><CloseBold></CloseBold></el-icon>\n			<span>关闭当前</span>\n		</div>\n		<div v-if=\"appStore.tagLength > 1\" class=\"icon-item\" @click=\"emits(\'closeOtherTags\')\">\n			<el-icon size=\"10\"><CircleClose></CircleClose></el-icon>\n			<span>关闭其他</span>\n		</div>\n		<div v-if=\"props.currentMenuTagIndex > 0\" class=\"icon-item\" @click=\"emits(\'closeLeftTag\')\">\n			<el-icon size=\"10\"><Back></Back></el-icon>\n			<span>关闭左侧</span>\n		</div>\n		<div v-if=\"props.currentMenuTagIndex < appStore.tagLength - 1\" class=\"icon-item\" @click=\"emits(\'closeRightTag\')\">\n			<el-icon size=\"10\"><Right></Right></el-icon>\n			<span>关闭右侧</span>\n		</div>\n		<div v-if=\"appStore.tagLength > 1\" class=\"icon-item\" @click=\"emits(\'closeAllTags\')\">\n			<el-icon size=\"10\"><Close></Close></el-icon>\n			<span>关闭全部</span>\n		</div>\n	</div>\n</template>\n\n<script setup lang=\"ts\">\nimport { Back, CircleClose, Close, CloseBold, Refresh, Right } from \'@element-plus/icons-vue\'\nimport { NavbarTag, useAppStore } from \'@/store/app-store\'\nimport { defineEmits, defineProps, PropType } from \'vue\'\nimport { useRoute } from \'vue-router\'\n\nconst route = useRoute()\nconst appStore = useAppStore()\n\nconst props = defineProps({\n	currentMenuTag: {\n		type: Object as PropType<NavbarTag>,\n		required: true\n	},\n	currentMenuTagIndex: {\n		type: Number,\n		required: true\n	}\n})\n\nconst emits = defineEmits([\'refreshCurrentTag\', \'closeCurrentTag\', \'closeAllTags\', \'closeOtherTags\', \'closeLeftTag\', \'closeRightTag\'])\n</script>\n\n<style scoped>\n.icon-list {\n	display: flex;\n	flex-direction: column;\n	gap: 10px;\n	padding: 6px;\n	width: 65px; /* 设置列表容器的宽度 */\n}\n\n.icon-item {\n	display: flex;\n	align-items: center;\n	gap: 5px;\n	font-size: 12px;\n	width: 100%; /* 让项目占满容器宽度 */\n	cursor: pointer; /* 鼠标变成小手 */\n	padding: 6px 8px;\n	border-radius: 4px;\n	transition:\n		background-color 0.2s ease,\n		color 0.2s ease; /* 动画过渡 */\n}\n\n/* 悬停效果 */\n.icon-item:hover {\n	background-color: #f0f0f0; /* 浅灰色高亮，可自定义颜色 */\n	color: #333; /* 可选：加深文字颜色 */\n}\n</style>\n', 0, '2025-08-07 10:29:04', '2025-08-07 10:29:04', 0);
INSERT INTO `gen_template` VALUES (293, 30, 'layout-sidebar-index.vue.ftl', '${frontendPath}/src/layout/sidebar/index.vue', '侧边首页', '<template>\n	<logo></logo>\n	<Menu></Menu>\n</template>\n\n<script setup lang=\"ts\">\nimport Menu from \'@/layout/sidebar/components/menu.vue\'\nimport Logo from \'@/layout/sidebar/components/logo.vue\'\n</script>\n', 0, '2025-08-07 10:29:44', '2025-08-07 17:14:59', 0);
INSERT INTO `gen_template` VALUES (294, 30, 'logo.vue.ftl', '${frontendPath}/src/layout/sidebar/components/logo.vue', 'logo页面', '<template>\n	<div class=\"logo-container\">\n		<el-avatar src=\"./favicon.ico\" size=\"small\" class=\"logo-avatar\"></el-avatar>\n		<el-text v-if=\"!appStore.isCollapseRef\" tag=\"b\">{{ appTitle }}</el-text>\n	</div>\n</template>\n<script setup lang=\"ts\">\nimport { useAppStore } from \'@/store/app-store\'\n\nconst appTitle = import.meta.env.VITE_APP_TITLE\nconst appStore = useAppStore()\n</script>\n\n<style scoped>\n.logo-container {\n	margin-left: 11px;\n	display: flex;\n	align-items: center;\n	padding: 8px;\n}\n\n.logo-avatar {\n	margin-right: 9px;\n	color: #2c3e50;\n	font-size: 16px;\n	font-weight: 550;\n}\n</style>\n', 0, '2025-08-07 10:30:34', '2025-08-07 10:33:00', 0);
INSERT INTO `gen_template` VALUES (295, 30, 'menu.vue.ftl', '${frontendPath}/src/layout/sidebar/components/menu.vue', '菜单页面', '<template>\n	<el-scrollbar>\n		<el-menu\n			:default-active=\"defaultActive\"\n			background-color=\"transparent\"\n			mode=\"vertical\"\n			:collapse-transition=\"false\"\n			router\n			:collapse=\"appStore.isCollapseRef\"\n		>\n			<menu-item v-for=\"menu in userStore.menuList\" :key=\"menu.path\" :menu=\"menu\"></menu-item>\n		</el-menu>\n	</el-scrollbar>\n</template>\n\n<script setup lang=\"ts\">\nimport MenuItem from \'@/layout/sidebar/components/menu-item.vue\'\nimport { useRoute } from \'vue-router\'\nimport { computed } from \'vue\'\nimport { useAppStore } from \'@/store/app-store\'\nimport { useUserStore } from \'@/store/user-store\'\n\nconst appStore = useAppStore()\nconst userStore = useUserStore()\nconst route = useRoute()\nconst defaultActive = computed(() => {\n	const { path } = route\n	return path\n})\n</script>\n', 0, '2025-08-07 10:31:51', '2025-08-07 17:21:28', 0);
INSERT INTO `gen_template` VALUES (296, 30, 'menu-item.vue.ftl', '${frontendPath}/src/layout/sidebar/components/menu-item.vue', '菜单项页面', '<template>\n	<el-sub-menu v-if=\"menu.meta.type === 0\" :key=\"\'sub-menu-\' + menu.path\" :index=\"menu.path\">\n		<template #title>\n			<svg-icon :icon=\"menu.meta.icon\"></svg-icon>\n			<el-tooltip :content=\"menu.meta.title\" :disabled=\"!isTitleOverflow\" placement=\"top\">\n				<el-text ref=\"titleRef\" truncated>{{ menu.meta.title }}</el-text>\n			</el-tooltip>\n		</template>\n		<!-- 递归渲染目录或者菜单 -->\n		<template v-if=\"menu.children && menu.children.length > 0\">\n			<menu-item v-for=\"sub in menu.children\" :key=\"\'sub-menu-\' + sub.path\" :menu=\"sub\"></menu-item>\n		</template>\n	</el-sub-menu>\n	<el-menu-item v-else-if=\"menu.meta.type === 1 && !menu.meta.hidden\" :key=\"\'menu-item-\' + menu.path\" :index=\"menu.path\">\n		<svg-icon :icon=\"menu.meta.icon\"></svg-icon>\n		<el-tooltip :content=\"menu.meta.title\" :disabled=\"!isTitleOverflow\" placement=\"top\">\n			<el-text ref=\"titleRef\" truncated>{{ menu.meta.title }}</el-text>\n		</el-tooltip>\n	</el-menu-item>\n</template>\n\n<script setup lang=\"ts\">\nimport { ref, onMounted, onUpdated, nextTick, onUnmounted } from \'vue\'\nimport SvgIcon from \'@/components/svg-icon/index.vue\'\nimport { ElText } from \'element-plus\'\n\ndefineProps({\n	menu: {\n		type: Object,\n		required: true\n	}\n})\n\nconst titleRef = ref<InstanceType<typeof ElText> | null>(null)\nconst isTitleOverflow = ref(false)\n\n// 检查文本是否溢出\nconst checkOverflow = () => {\n	nextTick(() => {\n		if (titleRef.value && titleRef.value.$el) {\n			const element = titleRef.value.$el\n			isTitleOverflow.value = element.scrollWidth > element.clientWidth\n		}\n	})\n}\n\n// 在组件挂载和更新时检查溢出\nonMounted(() => {\n	checkOverflow()\n})\n\nonUpdated(() => {\n	checkOverflow()\n})\n\n// 监听窗口大小变化\nlet resizeObserver: ResizeObserver | null = null\nonMounted(() => {\n	resizeObserver = new ResizeObserver(checkOverflow)\n	if (titleRef.value && titleRef.value.$el) {\n		resizeObserver.observe(titleRef.value.$el)\n	}\n})\n\nonUnmounted(() => {\n	if (resizeObserver) {\n		resizeObserver.disconnect()\n	}\n})\n</script>\n', 0, '2025-08-07 10:32:39', '2025-08-07 10:32:39', 0);
